var n='---\npageClass: page-reference\n---\n\n# Extensions\n\n<div class="two-up">\n<div class="left">\n\n> The extensions endpoints are used by the Admin App to retrieve what extensions to install.\n> [Learn more about Extensions](/concepts/extensions/).\n\n</div>\n<div class="right">\n\n[[toc]]\n\n</div>\n</div>\n\n---\n\n## List Extensions\n\nList the available extensions in the project. The types of extensions that you can list are interfaces, displays,\nlayouts, modules.\n\n<div class="two-up">\n<div class="left">\n\n### Query Parameters\n\nThis endpoint doesn\'t currently support any query parameters.\n\n### Returns\n\nAn array of interface extension keys.\n\n</div>\n<div class="right">\n\n### REST API\n\n```\nGET /extensions/:type\n```\n\n##### Example\n\n```\nGET /extensions/interfaces\n```\n\n### GraphQL\n\n```\nPOST /graphql/system\n```\n\n```graphql\ntype Query {\n\textensions: extensions\n}\n```\n\n##### Example\n\n```graphql\nquery {\n\textensions {\n\t\tinterfaces\n\t}\n}\n```\n\n</div>\n</div>\n';export{n as default};
